import React from "react";
import LogInForm from "./LogInForm";
import Logo from "./Images/PetFriendlyLogo.png";

function Home() {
  return (
    <div className="div-card row justify-content-center">
      <div className="max-height pb-2 col-12 col-md-5 order-md-2">
        <img className="logo-height" src={Logo} alt="Pet Friendly Logo"></img>

        <div className="form-height d-flex align-items-center" id="background">
          <LogInForm></LogInForm>
        </div>
      </div>

      <div className="max-height pb-2 col-12 col-md-7 order-md-1 d-none d-md-block">
        <div className="circle-front"></div>
      </div>
    </div>
  );
}

export default Home;
